import React from 'react';

const SupportInfo = () => (
  <section className="ernet-support-info">
    <p>
      <strong>Important Information for Support:</strong> Please send an email at 
      <a href="mailto:helpdesk@domain.ernet.in" className="ernet-support-email"> helpdesk@domain.ernet.in </a>
      to open a support Ticket which will be responded by our support team. <strong>Only support will be entertained along with the ticket number.</strong>
    </p>
    <p>
      <strong>Please note that ONLY online transactions through the payment gateway using the domain panel is accepted. Payment done through any other mode or directly to the bank account is not accepted.</strong>
    </p>
  </section>
);

export default SupportInfo;
